style.css:
@-moz-document domain("youtube.com"), url-prefix("http://youtube.com/") {
img.ytd-yoodle-renderer {
  width: 0px;
}

yt-icon.ytd-topbar-logo-renderer,
ytd-topbar-logo-renderer {
	filter: none;
	fill-opacity: 0;
	background: url("https://cdn.discordapp.com/attachments/996829406666440805/1269779814277972138/Penstigram_Logo.svg?ex=66b14e1b&is=66affc9b&hm=a7d95f5170f5031449e03c1427c86faf5ecc808984dca1bae701fcfa485c25b6&") center center/100% no-repeat!important;
	max-width: 270px;
  width: 270px;
	max-height: 100px;
	padding-left: 30px;
	margin-left: 13px;
	animation: yadlog 9s infinite alternate;
  position: relative!important;
}	

@keyframes vetlog {
	0% {filter: hue-rotate(360deg) saturate(3);}
}
.ytd-topbar-logo-renderer svg {
	background: none!important;
}
[d*="M27.9727 3.12324C27.6435 1.89323 26"],
[d*="M11.4253 14.2854L18.8477 10.0004L11.4253"] {
	stroke: #fff0!important;
}
	
#country-code.ytd-topbar-logo-renderer {
	color: #fff0;
	margin: 12px 0 0 2px;
	font-size: 70%;
  }
}
